mutation authBySms($phone: PhoneNumber!, $token: String!) {
  authBySms(phone: $phone, token: $token)
}

mutation phoneVerification($phone: String!) {
  phoneVerification(phone: $phone) {
    success
    interval
    __typename
  }
}

